class Solution(object):
    def openLock(self, deadends, target):
        """
        :type deadends: List[str]
        :type target: str
        :rtype: int
        """
        deadends = set(deadends)
        if target == "0000":
            return 0
        if "0000" in deadends:
            return -1

        N = len(target)
        from collections import deque
        bfs = deque()
        bfs.append(("0000", 1))
        visited = [0] * (10 ** N)
        visited[0] = 1
        while bfs:
            number, moves = bfs.popleft()
            for x in range(N):
                digits = []
                if number[x] == "0":
                    digits.append("1")
                    digits.append("9")
                elif number[x] == "9":
                    digits.append("0")
                    digits.append("8")
                else:
                    digits.append(str(int(number[x]) + 1))
                    digits.append(str(int(number[x]) - 1))
                for digit in digits:
                    next_number = number[:x] + digit + number[x+1:]
                    if next_number == target:
                        return moves
                    if next_number not in deadends:
                        if visited[int(next_number)] == 0:
                            bfs.append((next_number, moves + 1))
                            visited[int(next_number)] = 1
        return -1


